import React from "react";
import { Container, Row, Col } from "react-grid-system";

const PlayerList = ({ players }) => {
  if (!players.length) return "Click + to add players";

  return (
    <Container>
      {players.map(player => (
        <Row>
          <Col />
        </Row>
      ))}
    </Container>
  );
};

export default PlayerList;
